  return (


    <div className="container mt-4">
              <h2 className="text-center fw-bold mb-4">Panel de administraci√≥n</h2>

      <nav className="mb-4 d-flex gap-3">
        <Link to="/admin/tareas" className="btn btn-outline-primary d-flex align-items-center gap-2">
          <FaTasks /> Tareas
        </Link>
        <Link to="/admin/usuarios" className="btn btn-outline-secondary d-flex align-items-center gap-2">
          <FaUsers /> Usuarios
        </Link>
        <Link to="/register" className="btn btn-outline-success d-flex align-items-center gap-2">
          <FaUserPlus /> Registrar usuario
        </Link>
      </nav>

      <Outlet />
    </div>
  );
};

export default AdminLayout;
